import { ErrorMessage, Field, Form, Formik } from "formik";
import registerService from "../../services/registerService";
import "./register.css";

export default function Register() {
  return (
    <>
      <h2> Register </h2>
      <Formik
        initialValues={{ username: "", password: "" }}
        validate={values =>{const errors = {}

      if(!values.username){errors.username = 'Required username'}
      if(!values.password){errors.password = 'Required password'}

      return errors
    }}
        onSubmit={(values, { setFieldError }) => {
          return registerService(values)
          .catch((err) => {
            setFieldError("username", "username is not vaild ");
          });
        }}
      >
        {({ errors, isSubmitting, ErrorMessage }) => (
          <Form className="form i" >
            <Field
              name={"username"}

            ></Field>
            <Field name={"password"}></Field>
            <button className="btn" disabled={isSubmitting}>
              Register
            </button>
            <small>{ErrorMessage? <p> {ErrorMessage}</p>:''} </small>
          </Form>
        )}
      </Formik>
    </>
  );
}
